```json
{
"application": "GROMACS",
"details": {
"software": [
"GROMACS 2023.3",
"SLURM (for job submission and management)"
],
"resources": {
"nodes": 1,
"cores": 20,
"walltime": "48 hours",
"partition": "single",
"memory_per_core": "150 MB"
}
}
}
```

The script utilizes GROMACS 2023.3 for molecular dynamics simulations. It leverages SLURM for job submission and management, requesting a single node with 20 cores and 150 MB of memory per core.  The job is set to run for a maximum of 48 hours on the "single" partition.
